import Vue from 'vue'
import VueRouter from 'vue-router'
import LoginView from '../views/LoginView.vue'
//import HomeView from '../views/HomeView.vue'
import TesteVelocidadeView from '../views/TesteVelocidadeView.vue'
import SuporteView from '../views/SuporteView.vue'
import NotificaçõesView from '../views/NotificaçõesView.vue'
import CobrançasView from '../views/CobrançasView.vue'
import CobrançasPagasView from '../views/CobrançasPagasView.vue'
import BoletoView from '../views/BoletoView.vue'
import SubMenuComponent from '../components/SubMenuComponent.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'login',
    component: LoginView
  },
  {
    path: '/menu',
    name: 'menu',
    components:{
      a: SubMenuComponent,
    },
    children: [
      {
        path: '/menu/speedtest',
        name: 'teste de velocidade',
        components:{
          b: TesteVelocidadeView
        } 
      },
      {
        path: '/menu/suporte',
        name: 'suporte',
        components:{
          b: SuporteView
        } 
      },
      {
        path: '/menu/notificacoes',
        name: 'notificações',
        components: {
          b: NotificaçõesView
        } 
      },
      {
        path: '/menu/cobrancas',
        name: 'cobranças',
        components: {
          b: CobrançasView
        }
      },
      {
        path: '/menu/cobrancaspagas',
        name: 'cobranças pagas',
        components: {
          b: CobrançasPagasView
        }
      },
      {
        path: '/menu/boleto',
        name: 'boleto',
        components: {
          BoletoView
        }
      },
    ],
  },
]

const router = new VueRouter({
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})

export default router
